import base64
import vertexai
import json
from vertexai.preview.generative_models import GenerativeModel, Part
import vertexai.preview.generative_models as generative_models


def generateContent():
  print('Calling LLM')
  vertexai.init(project="cap-ai-squad", location="us-west1")
  model = GenerativeModel("gemini-1.0-pro-vision-001")
  responses = model.generate_content(
    ["""I am car repair assistant person.The name of the brand,model,color of the car can be found from the attachments which can be named as x,y and z respectively. Can you give me the list of all the spare part names of the car with brand x and model y. Can you provide the list of car parts in json format with json key as brand_name,car_name, model_name,model_number,car_color with json value as string or comma seperated string. Also provide list of car parts in json format with json key as part_name,exact_spare_part_cost.  exact_spare_part_cost value should be in indian currency with json value as string or comma seperated string. Output json with no nested objects. If latest data is not available share older one. Wrap json array with [ ] brackets. Return only the valid json string. x,y and z values are just for your reference,dont return them,only share me the json as explained.""", image1,image2,image3,image4],
    generation_config={
        "max_output_tokens": 2048,
        "temperature": 1,
        "top_p": 1,
        "top_k": 32
    },
    safety_settings={
          generative_models.HarmCategory.HARM_CATEGORY_HATE_SPEECH: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
          generative_models.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
          generative_models.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
          generative_models.HarmCategory.HARM_CATEGORY_HARASSMENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
    },
    stream=True,
  )
  
  content = ''
  for response in responses:
    content = content + response.text
  json_string = _clean_json(content)
  print('json_string')
  print(json_string)
  print('json_string end')
  json_data = {}
  json_data = json.loads(json_string)
  return json_data
    

def _clean_json(content: str):
  return content.strip().removeprefix('```').strip().removeprefix('json').removeprefix('JSON').strip().removesuffix('```')

image1 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/jpeg")
image2 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/jpeg")
image3 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/jpeg")
image4 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/jpeg")
